import { FormControl, FormGroup, Input, InputLabel } from "@mui/material"


const AllUsers = () => {
    return (
        <FormGroup>
            <FormControl>
                <InputLabel>Name</InputLabel>
                <Input />
            </FormControl>
        </FormGroup>
    )
}

export default AllUsers;
